ane do wybranych kluczy.','Ensure meta_data excludes specific keys.'=>'Upewnij się, że metadane wykluczają określone klucze.','Unsupported argument type provided as value.'=>'Jako wartość podano niewspierany rodzaj argumentu.','Summarize this product in 1-2 short sentences. We’ll show it at the top of the page.'=>'Podsumuj ten produkt w 1-2 krótkich zdaniach. Pokażemy je na górze strony produktu.','Empty Mini-Cart Message'=>'Wiadomość w pustym minikoszyku','Describe this product. What makes it unique? What are its most important features?'=>'Opisz ten produkt. Co czyni go unikatowym? Jakie są jego najważniejsze funkcje?','Product types define available product details and attributes, such as downloadable files and variations. They’re also used for analytics and inventory management.'=>'Typy produktów definiują szczegóły produktu i atrybuty, takie jak pliki do pobrania, czy warianty. Są również używane w statystykach i przy zarządzaniu magazynem.','<b>Variable –</b> a product with variations, each of which may have a different SKU, price, stock option, etc. For example, a t-shirt available in different colors and/or sizes.'=>'<b>Z wariantami –</b> produkt z wariantami, którego każdy z nich może posiadać inne SKU, cenę, stan magazynowy, itp. Przykładowo T-shirt dostępny w różnych kolorach i/lub rozmiarach.','<b>External or Affiliate –</b> one that you list and describe on your website but is sold elsewhere.'=>'<b>Zewnętrzny/afiliacyjny –</b> taki, który prezentujesz i opisujesz w swojej witrynie, ale jest sprzedawany gdzie indziej.','<b>Grouped –</b> a collection of related products that can be purchased individually and only consist of simple products. For example, a set of six drinking glasses.'=>'<b>Grupowy –</b> zbiór powiązanych ze sobą produktów prostych, którego każdy z nich można kupić z osobna. Przykładowo zestaw sześciu szklanek.','<b>Simple –</b> covers the vast majority of any products you may sell. Simple products are shipped and have no options. For exam