ały pliki, które mogą zawierać raporty ze %1$sstatystykami sklepu%2$s - zalecamy ocenę i usunięcie każdego z takich plików.','Edit page'=>'Edytuj stronę','%1$s at %2$s %3$s'=>'%1$s o %2$s %3$s','Direct updates'=>'Bezpośrednie aktualizacje','Update the table directly upon product changes, instead of scheduling a deferred update.'=>'Aktualizuj tabelę bezpośrednio po zmianach produktu, zamiast planować aktualizację  odłożoną w czasie.','Page titleRefund and Returns Policy'=>'Polityka zwrotów','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.'=>'Stworzyliśmy dla ciebie szkic przykładowej strony Polityki zwrotów. Dostosuj jej treść tak, aby pasowała do twojego sklepu.','Billing Phone Number'=>'Numer telefonu płatności','Shipping Phone Number'=>'Numer telefonu wysyłki','Enable table usage'=>'Włącz użycie tabeli','Product attributes lookup table'=>'Tabela do wyszukiwania atrybutów produktu','These settings are not available while the lookup table regeneration is in progress.'=>'Te opcje nie są dostępne w trakcie procesu odnawiania tabeli.','Use the product attributes lookup table for catalog filtering.'=>'Używaj tabeli do wyszukiwania atrybutów produktu do filtrowania katalogu.','Select a product to regenerate the data for, or leave empty for a full table regeneration:'=>'Wybierz produkt do odnowienia danych lub pozostaw pole puste, aby odnowić całą tabelę:','Page slugrefund_returns'=>'zwroty','Additional data to pass to the extension'=>'Dodatkowe dane do przekazania do rozszerzenia','Extension\'s name - this will be used to ensure the data in the request is routed appropriately.'=>'Nazwa rozszerzenia – zostanie użyta, aby upewnić się, że dane z żądania są przekierowane.','N. Revenue (formatted)'=>'Przychód netto (sformatowany)','Net total revenue (formatted).'=>'Całkowity przychód netto (sformatowany).','When true, refunded items are restocked.'=>'Jeśli "true", stan magazynowy zwróconych pozycji jest przywrócony.','Enable WooCommerce Analytics'=>'Włącz Analitykę WooCommerce','Save time and money with WooCommerce Shipping'=>'Oszczędzaj czas i pieniądze przy pomocy WooCommerce Shipping','Print discounted USPS and DHL labels straight from your WooCommerce dashboard and save on shipping.'=>'Drukuj tańsze etykiety USPS i DHL prosto z kokpitu WooCommerce i oszczędzaj na wysyłce.','Setup a Refund and Returns Policy page to boost your store\'s credibility.'=>'Skonfiguruj stronę Polityki zwrotów, aby zwiększyć wiarygodność twojego sklepu.','Limit result set to products that are low or out of stock. (Deprecated)'=>'Ogranicz wyniki do produktów, które mają niski stan magazynowy, lub brak ich w magazynie. (Przestarzałe)','%1$s could not be served using the X-Accel-Redirect/X-Sendfile method. A Force Download will be used instead.'=>'Nie można było obsłużyć %1$s za pomocą metody X-Accel-Redirect/X-Sendfile. W zamian zostanie użyte wymuszenie pobierania.','%1$s could not be served using the Force Download method. A redirect will be used instead.'=>'Nie można było obsłużyć %1$s za pomocą metody wymuszenia pobierania. W zamian zostanie użyte przekierowanie.','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Jeśli wybrano metodę pobierania "Wymuszaj pobieranie" lub "X-Accel-Redirect/X-Sendfile", ale nie będzie ona działać, system użyje w ostateczności metody "Tylko przekierowanie". <a href="%1$s">Zobacz ten przewodnik</a>, aby uzyskać więcej informacji.','Allow using redirect mode (insecure) as a last resort'=>'Zezwól na użycie przekierowania jako ostateczność (niebezpieczne)','Choose payment providers and enable payment methods at checkout.'=>'Wybierz pośredników i włącz metody płatności na stronie zamówienia.','Set your store location and where you\'ll ship to.'=>'Ustaw lokalizację swojego sklepu i miejsca, do których będziesz wysyłać.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Już tylko krok dzieli cię od otrzymywania płatności. Zweryfikuj dane swojej firmy, aby rozpocząć zarządzanie transakcjami za pomocą WooPayments.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Zacznij od dodania pierwszego produktu do sklepu. Możesz dodać swoje produkty ręcznie, przez CSV lub zaimportować je z innej usługi.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Adres twojego sklepu jest wymagany, żeby ustawić kraj wysyłki, waluty i opcje płatności.','Grow your store'=>'Rozwijaj swój sklep','Get backups'=>'Skorzystaj z kopii zapasowych','Protect your WooCommerce Store with Jetpack Backup.'=>'Chroń swój sklep WooCommerce za pomocą kopii zapasowych Jetpack.','Good choice! You chose to add %1$s and %2$s to your store.'=>'Dobry wybór! Wybrano %1$s i %2$s do dodania do sklepu.','Set your store location and configure tax rate settings.'=>'Skonfiguruj lokalizację twojego sklepu i stawki podatkowe.','Notes are unavailable because the "admin-note" data store cannot be loaded.'=>'Notatki nie są dostępne, ponieważ magazyn danych "admin-note" nie mógł zostać wczytany.','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.'=>'Przerwy w pracy sklepu wiążą się ze stratami. Za pomocą jednego kliknięcia można szybko przywrócić swój sklep online, jeśli coś pójdzie nie tak.','The rate at which tax is applied.'=>'Stawka, wg której obliczany jest podatek.','Mollie'=>'Mollie','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Rozszerzenie Payfast dla WooCommerce umożliwia przyjmowanie płatności kartą kredytową i EFT za pośrednictwem jednej z najpopularniejszych bramek płatniczych w RPA. Brak opłat aktywacyjnych czy miesięcznych kosztów subskrypcji. Wybranie tego rozszerzenia ustawi w twoim sklepie randów południowoafrykańskich jako wybraną walutę.','Products sold'=>'Sprzedane produkty','Variations Sold'=>'Sprzedane warianty','Number of product items sold.'=>'Liczba sprzedanych produktów.','Data store:'=>'Magazyn danych:','This section shows details of Action Scheduler.'=>'Ta sekcja pokazuje szczegóły Harmonogramu akcji.','Change status to cancelled'=>'Zmień status na anulowano','Number of variation items sold.'=>'Liczba sprzedanych wariantów.','Recently Viewed Products list'=>'Lista ostatnio oglądanych produktów','Products by Rating list'=>'Lista produktów wg oceny','Source of note.'=>'Źródło notatki.','Download %d ID'=>'Identyfikator %d pliku do pobrania','Things to do next'=>'Następne kroki','Manage transactions without leaving your WordPress Dashboard. Only with WooPayments.'=>'Zarządzaj transakcjami bez opuszczania swojego kokpitu WordPress. Tylko z WooPayments.','A link to a product category.'=>'Link do kategorii produktu.','A link to a product tag.'=>'Link do tagu produktu.','A link to a product.'=>'Link do produktu.','Create and send purchase follow-up emails, newsletters, and promotional campaigns straight from your dashboard.'=>'Twórz i wysyłaj e-maile uzupełniające, newslettery i kampanie promocyjne bezpośrednio z kokpitu.','How easy was it to add a product tag?'=>'Jak łatwo było dodać tag produktu?','Invalid path provided.'=>'Podano nieprawidłową ścieżkę.','Product Category Link'=>'Link kategorii produktu','Product Link'=>'Link produktu','Product Tag Link'=>'Link tagu produktu','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain 