aksymalna ilość, którą można dodać do koszyka to %s','Category image.'=>'Obrazek kategorii.','The name of the tax.'=>'Nazwa podatku.','Error code'=>'Kod błędu','The coupons unique code.'=>'Unikalny kod kuponu.','Delivery time estimate text, e.g. 3-5 business days.'=>'Tekst przewidywanego czasu dostawy, np. 3-5 dni roboczych','Total tax on fees.'=>'Całkowity podatek od opłat.','Total price of items in the cart.'=>'Łączna wartość produktów w koszyku.','Total price of any applied fees.'=>'Łączna wartość wszystkich naliczonych opłat.','Total discount from applied coupons.'=>'Całkowity rabat z zastosowanych kuponów.','Total tax removed due to discount from applied coupons.'=>'Całkowity odjęty podatek po zastosowaniu kuponów.','Total tax removed due to discount applied by this coupon.'=>'Całkowita wartość podatku odjętego przy zastosowaniu rabatu z tego kuponu. ','Total tax applied to items and shipping.'=>'Całkowita wartość podatku towarów z wysyłką.','Lines of taxes applied to items and shipping.'=>'Linie podatków dla towarów z wysyłką.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'Adres URL, na który przekierować klienta po zamówieniu. Może to być na przykład odnośnik do strony operatora płatności.','%1$s requires an instance of %2$s or %3$s for the address'=>'%1$s wymaga wystąpienia %2$s lub %3$s dla adresu','Name of the item.'=>'Nazwa elementu.','ID of the shipping method that provided the rate.'=>'Identyfikator metody wysyłki, która określała stawkę.','Price of this shipping rate using the smallest unit of the currency.'=>'Cena stawki wysyłkowej przy zastosowaniu najmniejszej jednostki waluty.','Description of the shipping rate, e.g. Dispatched via USPS.'=>'Opis stawki wysyłkowej, np. Wysyłana przez USPS.','Name of the shipping rate, e.g. Express shipping.'=>'Nazwa stawki wysyłkowej, np. Wysyłka ekspresowa.','ID of the shipping rate.'=>'Identyfikator stawki wysyłkowej.','List of shipping rates.'=>'Lista stawek wysyłkowych.','The amount of tax charged.'=>'Wysokość naliczonego podatku.','Total price the customer will pay.'=>'Całkowita cena, którą zapłaci klient.','True if the cart needs payment. False for carts with only free products and no shipping costs.'=>'Prawda, jeśli koszyk wymaga płatności. Fałsz, gdy koszyk zawiera tylko darmowe produkty, bez kosztów wysyłki.','List of available shipping rates for the cart.'=>'Lista dostępnych stawek wysyłkowych dla koszyka.','List of applied cart coupons.'=>'Lista zastosowanych kuponów w koszyku.','Returns number of products within attribute terms.'=>'Zwraca liczbę produktów w ramach atrybutów taksonomii.','Min and max prices found in collection of products, provided using the smallest unit of the currency.'=>'Minimalne i maksymalne ceny występujące w kolekcji produktów, podane przy użyciu najmniejszej jednostki waluty.','Country/Region code in ISO 3166-1 alpha-2 format.'=>'Kod kraju/regionu w formacie ISO 3166-1 alpha-2.','State/County code, or name of the state, county, province, or district.'=>'Kod stanu/powiatu lub nazwa stanu, powiatu, prowincji lub okręgu.','Price prefix for the currency which can be used to format returned prices.'=>'Prefiks ceny dla waluty, która może być używana do formatowania zwracanych cen.','Thousand separator for the currency which can be used to format returned prices.'=>'Separator tysięczny dla waluty, który może być używany do formatowania zwracanych cen.','Decimal separator for the currency which can be used to format returned prices.'=>'Separator dziesiętny dla waluty, który może być używany do formatowania zwracanych cen.','Currency minor unit (number of digits after the decimal separator) for returned prices.'=>'Mniejsza jednostka walutowa (liczba cyfr po przecinku) dla zwracanych cen.','Currency symbol for the currency which can be used to format returned prices.'=>'Symbol waluty dla waluty, która może być używana do formatowania zwracanych cen.','Currency code (in ISO format) for returned prices.'=>'Kod waluty (w formacie ISO) dla zwracanych cen.','Total discount applied by this coupon.'=>'Łączna zniżka zastosowana przy wykorzystaniu tego kuponu.','Total amounts provided using the smallest unit of the currency.'=>'Łączne kwoty podane przy użyciu najmniejszej jednostki waluty.','An array of data being returned from the payment gateway.'=>'Tablica danych zwracanych przez bramkę płatności.','Status of the payment returned by the gateway. One of success, pending, failure, error.'=>'Status płatności zwracanej przez bramkę. Jeden z: sukces, w toku, niepowodzenie, błąd.','The ID of the payment method being used to process the payment.'=>'Identyfikator metody płatności używanej do dokonania zapłaty.','Quantity of the item in the current package.'=>'Ilość sztuk w paczce.','List of cart items the returned shipping rates apply to.'=>'Lista artykułów w koszyku, do których odnoszą się koszty wysyłki.','Shipping destination address.'=>'Adres wysyłki.','Name of the package.'=>'Nazwa paczki.','The ID of the package the shipping rates belong to.'=>'Identyfikator paczki, do której mają zastosowanie stawki za wysyłkę.','List of cart item errors, for example, items in the cart which are out of stock.'=>'Lista błędnych pozycji w koszyku, np. pozycje w koszyku, których nie ma w magazynie.','Total tax on items in the cart.'=>'Całkowity podatek od pozycji w koszyku.','Cart total amounts provided using the smallest unit of the currency.'=>'Łączne kwoty z koszyka podane przy użyciu najmniejszej jednostki waluty.','Current set shipping address for the customer.'=>'Aktualnie ustawiony adres wysyłki klienta.','Number of reviews for products in this category.'=>'Liczba opinii produktów w tej kategorii.','Result of payment processing, or false if not yet processed.'=>'Wynik przetworzenia płatności lub fałsz, gdy płatność nie została jeszcze przetworzona.','Error message'=>'Komunikat błędu','Apartment, suite, etc.'=>'Apartament, kawalerka itp.','Total price of shipping.'=>'Suma wysyłki.','Coupons are disabled.'=>'Kupony są wyłączone.','"%s" is an invalid coupon code.'=>'Kod kuponu "%s" jest nieprawidłowy.','New quantity of the item in the cart.'=>'Nowa ilość produktu w koszyku.','Sort ascending or descending.'=>'Sortuj rosnąco lub malejąco.','City of the address being shipped to.'=>'Miasto adresu wysyłki.','Invalid coupon code.'=>'Nieprawidłowy kod kuponu.','Unique identifier for the coupon within the cart.'=>'Unikalny identyfikator kuponu w koszyku.','"%s" has already been applied and cannot be used in conjunction with other coupons.'=>'"%s" został już zastosowany i nie może być użyty w połączeniu z innymi kuponami.','Cart item no longer exists or is invalid.'=>'Pozycja w koszyku już nie istnieje lub jest nieprawidłowa.','Cart item is invalid.'=>'Pozycja w koszyku jest nieprawidłowa.	','Note added to the order by the customer during checkout.'=>'Uwaga dodana do zamówienia przez klienta podczas dokonywania zakupu.','Order key used to check validity or protect access to certain order data.'=>'Klucz zamówienia używany do sprawdzania poprawności lub ochrony dostępu do pewnych danych zamówienia.','Order status. Payment providers will update this value after payment.'=>'Status zamówienia. Dostawcy usług płatniczych będą aktualizować tę wartość po zrealizowaniu płatności.','The order ID to process during checkout.'=>'Identyfikator zamówienia do przetworzenia podczas zamówienia.','Parent term ID, if applicable.'=>'Identyfikator nadrzędnej taksonomii, jeśli dotyczy.','Quantity left in stock if stock is low, or null if not applicable.'=>'Ilość pozostała w magazynie, jeżeli stan magazynowy jest niski lub pusty, jeżeli nie ma zastosowania.','List of variation IDs, if applicable.'=>'Lista identyfikatorów wariantów, jeśli dotyczy.','Price string formatted as HTML.'=>'Cena sformatowana jako HTML.','Price data provided using the smallest unit of the currency.'=>'Cena wyrażona w najmniejszej jednostce waluty.','Product full description in HTML format.'=>'Pełny opis produktu w formacie HTML.','Product short description in HTML format.'=>'Krótki opis produktu w formacie HTML.','ID of the parent product, if applicable.'=>'Identyfikator produktu nadrzędnego, jeśli dotyczy.','&quot;%s&quot; is not available for purchase.'=>'&quot;%s&quot; nie jest dostępny do zakupu.','The "%1$s" coupon has been removed from your cart: %2$s'=>'Kupon "%1$s" został usunięty z koszyka: %2$s','Coupon code "%s" has already been applied.'=>'Kod kuponu "%s" został już zastosowany.','Invalid coupons were removed from the cart: "%s"'=>'Nieprawidłowe kupony zostały usunięte z koszyka: "%s"','Cannot create order from empty cart.'=>'Nie można utworzyć zamówienia z pustego koszyka.','The chosen rate ID for the package.'=>'Wybrany identyfikator stawki dla paczki.','Method not implemented'=>'Metoda nie zaimplementowana','Unique identifier (key) for the cart item to update.'=>'Unikatowy identyfikator (klucz) dla aktualizowanej pozycji w koszyku.','No payment method provided.'=>'Nie wybrano żadnej metody płatności.','Invalid payment result received from payment method.'=>'Nieprawidłowy rezultat płatności z wybranej metody płatności.','Data to pass through to the payment method when processing payment.'=>'Dane do przekazania przy przetwarzaniu płatności do metody płatności.','If true, empty terms will not be returned.'=>'Jeśli prawda, puste taksonomie nie zostaną zwrócone.','Sort by term property.'=>'Sortuj po taksonomii.','Coupon does not exist in the cart.'=>'Kupon nie istnieje w koszyku.','Coupon cannot be removed because it is not already applied to the cart.'=>'Kupon nie może zostać usunięty, ponieważ nie został zastosowany do koszyka.','ISO code for the country of the address being shipped to.'=>'Kod ISO kraju wysyłki.','Zip or Postcode of the address being shipped to.'=>'Kod pocztowy adresu wysyłki.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'Kod ISO lub nazwa państwa, prowincji lub okręgu adresu wysyłki.','Second line of the address being shipped to.'=>'Druga linia adresu wysyłki.','First line of the address being shipped to.'=>'Pierwsza linia adresu wysyłki.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Ogranicz wynik do produktów na podstawie ceny minimalnej, podanej z wykorzystaniem najmniejszej jednostki waluty.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Ogranicz wynik do produktów w oparciu o cenę maksymalną, podaną przy użyciu najmniejszej jednostki waluty.','Customer ID if registered. Will return 0 for guests.'=>'Identyfikator klienta, jeśli klient był zarejestrowany. Zwraca 0 dla gości.','Unique identifier (key) for the cart item.'=>'Unikalny identyfikator (klucz) dla pozycji w koszyku.','Limit result set to reviews from specific category IDs.'=>'Ogranicz wyniki do opinii o produktach powiązanych z określonych identyfikatorami kategorii.','Limit result set to reviews from specific product IDs.'=>'Ogranicz wyniki do opinii o produktach powiązanych z określonymi identyfikatorami produktów.','The %s payment gateway is not available.'=>'Bramka płatności %s jest niedostępna.','Verify database'=>'Zweryfikuj bazę danych','Invalid category ID.'=>'Nieprawidłowy identyfikator kategorii.','Remove legacy coupon menu'=>'Usuń przestarzałe menu kuponów','First order received'=>'Otrzymano pierwsze zamówienie','Database verified successfully.'=>'Pomyślnie zweryfikowano bazę danych.','Verifying database... One or more tables are still missing: '=>'Weryfikowanie bazy danych… Nadal brakuje jednej lub więcej tabel:','Verify base database tables'=>'Zweryfikuj tabele bazy danych','Verify if all base database tables are present.'=>'Zweryfikuj, czy istnieją wszystkie tabele bazy danych.','Clear template cache'=>'Wyczyść pamięć podręczną szablonów','This tool will empty the template cache.'=>'To narzędzie usunie pamięć podręczną szablonów.','Template cache cleared.'=>'Pamięć podręczna szablonów została wyczyszczona.','The active version of WooCommerce does not support template cache clearing.'=>'Włączona wersja WooCommerce nie obsługuje czyszczenia pamięci podręcznej szablonów.','You need WooCommerce 4.2 or newer to run this tool.'=>'Musisz mieć WooCommerce 4.2 lub nowszy, aby uruchomić to narzędzie.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Tworzenie tabeli WooCommerce %1$s nie powiodło się. Czy użytkownik %2$s ma uprawnienia CREATE w bazie danych %3$s?','Collect and validate EU VAT numbers at checkout'=>'Pobieranie i walidacja numerów VAT UE w momencie składania zamówienia','Get real-time order alerts anywhere'=>'Otrzymuj powiadomienia o zamówieniach w czasie rzeczywistym w dowolnym miejscu','Coupons can now be managed from Marketing > Coupons. Click the button below to remove the legacy WooCommerce > Coupons menu item.'=>'Kuponami można teraz zarządzać za pomocą opcji Marketing > Kupony. Kliknij poniższy przycisk, aby usunąć dotychczasową pozycję menu WooCommerce > Kupony.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Maksymalna liczba artykułów, które mają być zwrócone w wyniku. Domyślnie bez limitu, jeśli pozostawiono puste.','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Jeśli twój sklep znajduje się na terenie UE, zalecamy, aby oprócz podatków automatycznych, korzystać z rozszerzenia EU VAT Number. Dzięki niemu w momencie składania zamówienia zostanie wyświetlone pole do pobrania i walidacji numeru VAT UE klienta, jeśli taki posiada.','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Dzięki aplikacji Woo możesz otrzymywać powiadomienia o aktywności w sklepie, w tym o nowych zamówieniach i opiniach produktów bezpośrednio na swoich urządzeniach mobilnych.','Coupon management has moved!'=>'Zarządzanie kuponami zostało przeniesione!','Do you need help with adding your first product?'=>'Potrzebujesz pomocy przy dodawaniu pierwszego produktu?','Start your online clothing store'=>'Uruchom swój sklep internetowy z odzieżą','The admin note layout has a wrong prop value.'=>'Układ notatki administratora ma błędną wartość.','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Ten samouczek z filmem pomoże ci przejść przez proces dodawania pierwszego produktu w WooCommerce.','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Założenie strony internetowej z modą jest emocjonujące, ale może też okazać się przytłaczające. W tym artykule przeprowadzimy cię przez proces konfiguracji, nauczymy tworzenia udanej prezentacji produktów i pokażemy ci, jak dotrzeć do idealnego odbiorcy.','Share feedback'=>'Podziel się uwagami','Watch tutorial'=>'Obejrzyj tutorial','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Skoro zostaliśmy twoim partnerem, naszym priorytetem jest zapewnienie odpowiednich narzędzi do spełnienia twoich potrzeb. Z niecierpliwością czekamy na twoje uwagi i opinie na temat konfiguracji sklepu, abyśmy mogli w przyszłości udoskonalić nasze rozwiązanie.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Zmiana platformy eHandlu może wydawać się dużą przeszkodą do pokonania, ale przeniesienie produktów, klientów i zamówień do WooCommerce jest łatwiejsze niż myślisz. Ten artykuł pomoże ci przejść przez ten proces.','Do you want to migrate from Shopify to WooCommerce?'=>'Czy chcesz przenieść swój biznes z Shopify do WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'WooCommerce Subscriptions pozwalają na wprowadzenie różnych subskrypcji na fizyczne lub wirtualne produkty i usługi. Twórz miesięczne kluby, cotygodniowe subskrypcje usług, a nawet roczne pakiety rozliczeniowe oprogramowania. Dodaj opłaty za subskrypcję, zaoferuj bezpłatne testy i ustaw okresy ważności.','Features'=>'Funkcje','Views'=>'Wyświetlenia','Visitors'=>'Odwiedzający','Homa Bay'=>'Homa Bay','Isiolo'=>'Isiolo','Bungoma'=>'Bungoma','Elgeyo-Marakwet'=>'Elgeyo-Marakwet','Baringo'=>'Baringo','Bomet'=>'Bomet','Uasin Gishu'=>'Uasin Gishu','Vihiga'=>'Vihiga','Wajir'=>'Wajir','West Pokot'=>'West Pokot','Do you need more info about WooCommerce Subscriptions?'=>'Potrzebujesz więcej informacji na temat Subskrypcji WooCommerce?','Nyeri'=>'Nyeri','Nyandarua'=>'Nyandarua','Narok'=>'Narok','Nyamira'=>'Nyamira','Nandi'=>'Nandi','Nakuru'=>'Nakuru','Nairobi County'=>'Hrabstwo Nairobi','Murang’a'=>'Murang’a','Mombasa'=>'Mombasa','Migori'=>'Migori','Meru'=>'Meru','Marsabit'=>'Marsabit','Mandera'=>'Mandera','Makueni'=>'Makueni','Machakos'=>'Machakos','Plugins were successfully activated.'=>'Wtyczki zostały włączone.','Plugins were successfully installed.'=>'Wtyczki zostały zainstalowane.','There was a problem activating some of the requested plugins.'=>'Wystąpił błąd podczas włączania niektórych żądanych wtyczek.','&quot;%s&quot; is out of sto