nie. Nie zapomnij o spersonalizowaniu strony głównej, którą stworzyliśmy dla twojego sklepu podczas procesu instalacji.','Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooPayments</strong>.'=>'Bezpiecznie akceptuj płatności katami kredytowymi i debetowymi. Zarządzaj transakcjami z poziomu kokpitu WooCommerce. Działa tylko z <strong>WooPayments</strong>.','There was an error communicating with the WooPayments plugin.'=>'Wystąpił błąd w komunikacji z wtyczką WooPayments.','Try the new way to get paid'=>'Wypróbuj nowy sposób płatności','It appears one or more database tables were missing. Attempting to re-create the missing table(s).'=>'Wygląda na to, że w bazie danych brakuje co najmniej jednej wymaganej tabeli. Próbuję odtworzyć brakujące tabele.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Twój sklep jest skonfigurowany do obsługi produktów wirtualnych przy użyciu metody "Tylko przekierowanie". Ta metoda jest przestarzała, <a href="%s">zamiast tego przełącz się na inną.</a><br><em>Jeśli do pobierania plików używasz zdalnego serwera (na przykład Dysk Google, Dropbox, Amazon S3), właściwa metoda zostanie zastosowana automatycznie, więc wybierz dowolną inną opcję, aby pozbyć się tego powiadomienia.</em>','There was an error connecting to Woo.com. Please try again.'=>'Wystąpił błąd podczas łączenia z Woo.com. Proszę spróbować ponownie.','Get started'=>'Rozpocznij','Choose theme'=>'Wybierz motyw','Send targeted campaigns, recover abandoned carts and much more with Mailchimp.'=>'Wysyłaj kampanie reklam