mentation</a>.'=>'Klucz, który zostanie użyty do integracji z usługami lokalizacji MaxMind. Dowiedz się jak go wygenerować z <a href="%1$s">dokumentacji integracji MaxMind</a>.','Learn more about how usage tracking works, and how you\'ll be helping in our <a href="%1$s" target="_blank">usage tracking documentation</a>.'=>'Dowiedz się więcej na temat działania opcji śledzenia i w jaki sposób możesz pomóc w <a href="%1$s" target="_blank">naszej dokumentacji</a>.','An unexpected error happened while applying the Coupon %s.'=>'Wystąpił niespodziewany błąd podczas realizacji kuponu %s.','Failed to download the MaxMind database.'=>'Pobieranie bazy danych MaxMind nie powiodło się.','Coupon %s was used in another transaction during this checkout, and coupon usage limit is reached. Please remove the coupon and try again.'=>'Podczas składania zamówienia użyto kuponu %s w innej transakcji i limit wykorzystania kuponu został osiągnięty. Usuń kupon i spróbuj ponownie.','You have used this coupon %s in another transaction during this checkout, and coupon usage limit is reached. Please remove the coupon and try again.'=>'Podczas składania zamówienia użyto tego kuponu %s w innej transakcji i limit wykorzystania kuponu został już osiągnięty. Usuń kupon i spróbuj ponownie.','%1$s should not be called before the %2$s, %3$s and %4$s actions have finished.'=>'%1$s nie powinna być wywoływana przed zakończeniem akcji %2$s, %3$s i %4$s.','The MaxMind license key is invalid. If you have recently created this key, you may need to wait for it to become active.'=>'Nieprawidłowy klucz licencyjny MaxMind. Jeśli stworzyłeś klucz niedawno, może minąć trochę czasu, zanim zostanie aktywowany. ','An integration for utilizing MaxMind to do Geolocation lookups. Please note that this integration will only do country lookups.'=>'Integracja geolokalizacji przy użyciu MaxMind. Pamiętaj, że ta integracja wyszukuje jedynie kraje.','The location that the MaxMind database should be stored. By default, the integration will automatically save the database here.'=>'Lokalizacja, w której będzie przechowywana baza danych MaxMind. Domyślnie integracja zapisze bazę tutaj.','Search results for "%s"'=>'Wyniki wyszukiwania dla „%s”','Welcome to'=>'Witamy w','Yes please'=>'Tak, poproszę','The "WooCommerce Admin" plugin will be installed and activated'=>'Wtyczka "WooCommerce Admin" zostanie zainstalowana i włączona','You must enter a valid license key on the <a href="%1$s">MaxMind integration settings page</a> in order to use the geolocation service. If you do not need geolocation for shipping or taxes, you should change the default customer location on the <a href="%2$s">general settings page</a>.'=>'Musisz wprowadzić prawidłowy klucz licencyjny na <a href="%1$s">stronie ustawień integracji z MaxMind</a>, aby rozpocząć korzystanie z usługi geolokalizacji. Jeśli nie potrzebujesz geolokalizacji do wysyłki lub obliczania podatków, zmień domyślną lokalizację klienta na <a href="%2$s"> stronie ustawień ogólnych</a>.','Get your store up and running more quickly with our new and improved setup experience'=>'Uruchom swój sklep szybciej z naszym nowym, ulepszonym interfejsem konfiguracji. ','Geolocation has not been configured.'=>'Geolokalizacja nie została skonfigurowana.','Shipping costs are calculated during checkout.'=>'Koszty wysyłki zostaną obliczone przy zamówieniu. ','Every 15 Days'=>'Co 15 dni','%s is a variable product parent and cannot be added.'=>'%s jest produktem z wariantami i nie może zostać dodany.','Search products…'=>'Szukaj produktów…','The date the review was created, in the site\'s timezone in human-readable format.'=>'Data utworzenia opinii, w strefie czasowej witryny, w formacie czytelnym dla człowieka.','Name of the product that the review belongs to.'=>'Nazwa produktu, do którego należy opinia.','Permalink of the product that the review belongs to.'=>'Link produktu, do którego należy opinia.','Image of the product that the review belongs to.'=>'Obrazek produktu, do