count, automatically generate an account username for the customer based on their name, surname or email'=>'Podczas tworzenia konta, automatycznie wygeneruj nazwę użytkownika dla klienta na podstawie jego imienia, nazwiska lub adresu e-mail','List additional tax classes you need below (1 per line, e.g. Reduced Rates). These are in addition to "Standard rate" which exists by default.'=>'Wpisz dodatkowe stawki podatkowe (jedna na linię). To są dodatkowe stawki oprócz "Standardowej stawki".','Did you know you can print shipping labels at home?'=>'Czy wiesz że możesz drukować etykiety w domu?','Use WooCommerce Shipping (powered by WooCommerce Services & Jetpack) to save time at the post office by printing your shipping labels at home.'=>'Użyj WooCommerce Shipping (obsługiwanego przez WooCommerce Services i Jetpack), aby zaoszczędzić swój czas na poczcie, drukując etykiety wysyłkowe w domu.','Manage your store\'s reports and monitor key metrics with a new and improved interface and dashboard.'=>'Zarządzaj raportami swojego sklepu i monitoruj kluczowe dane za pomocą nowego i ulepszonego kokpitu.','Reduced rate'=>'Obniżona stawka','Zero rate'=>'Zerowa stawka','WooCommerce REST API package'=>'Pakiet WooCommerce REST API','Generate coupon code'=>'Wygeneruj kod kuponu','Data: %1$.2fMB + Index: %2$.2fMB + Engine %3$s'=>'Dane: %1$.2fMB + Indeks: %2$.2fMB + Silnik %3$s','The WooCommerce REST API package running on your site.'=>'Pakiet WooCommerce REST API uruchomiony w twojej witrynie.','Drag and drop to set admin attribute order'=>'Przeciągnij i upuść aby ustalić kolejność atrybutów','Unable to detect the REST API package.'=>'Nie udało się wykryć pakietu REST API.','Database information:'=>'Informacje na temat bazy danych:','Unable to retrieve database information. Usually, this is not a problem, and it only means that your install is using a class that replaces the WordPress database class (e.g., HyperDB) and WooCommerce is unable to get database information.'=>'Nie można pobrać informacji o bazie danych. Zwykle nie stanowi to problemu, a oznacza to tylko, że twoja instalacja używa klasy, która zastępuje klasę bazy danych WordPress (np. HyperDB), a WooCommerce nie może uzyskać informacji o bazie danych.','Thanks for using {site_url}!'=>'Dziękujemy za korzystanie z {site_url}!','Congratulations on the sale.'=>'Świetnie ci idzie.','Text to appear below the main email content.'=>'Tekst, który pojawi się poniżej głównej treści e-maila.','Town / Village'=>'Miasto / Wieś','Invalid field'=>'Nieprawidłowe pole','Postal code'=>'Kod pocztowy','Tax class requires a valid name'=>'Klasa podatkowa wymaga prawidłowej nazwy','Tax class slug already exists'=>'Uproszczona nazwa klasy podatkowej już istnieje','Additional content'=>'Dodatkowa treść','Or you can download a pre-built version of the plugin from the <a href="%1$s">WordPress.org repository</a> or by visiting <a href="%2$s">the releases page in the GitHub repository</a>.'=>'Możesz też pobrać wersję wtyczki z <a href="%1$s">katalogu WordPress.org</a> lub przechodząc na <a href="%2$s">stronę w repozytorium GitHub</a>.','Order not editable'=>'Nie można edytować zamówienia','The Rest API is unavailable.'=>'Rest API niedostępne.','Learn how to upgrade'=>'Dowiedz się, jak zaktualizować','The sale will start at 00:00:00 of "From" date and end at 23:59:59 of "To" date.'=>'Promocja rozpocznie się o godzinie 00:00:00 w dniu "Od" i zakończy o godzinie 23:59:59 w dniu "Do".','Order fully refunded.'=>'Zamówienie zwrócone w całości.','Selecting no country / region to sell to prevents from completing the checkout. Continue anyway?'=>'Brak wyboru kraju lub regionu, do którego chcesz sprzedawać skutkuje zablokowaniem możliwości złożenia zamówienia. Kontynuować mimo to?','Note: WP CRON has been disabled on your install which may prevent this update from completing.'=>'Uwaga: WP CRON został wyłączony podczas instalacji, co może uniemożliwić dokończenie tej aktualizacji.','Product display, sorting, and reports may not be accurate until this finishes. It will take a few minutes and this notice will disappear when complete.'=>'Wyświetlanie produktów, sortowanie i raporty mogą nie być dokładne do zakończenia. Zajmie to kilka minut, a powiadomienie zniknie po zakończeniu.','You can manually run queued updates here.'=>'Tutaj można ręcznie uruchamiać aktualizacje w kolejce.','&larr; Back to "%s" attributes'=>'&larr; Wróć do atrybutów "%s"','There was a failure fetching this action'=>'Wystąpił błąd pobierania działania','Please enter a valid Eircode.'=>'Proszę wpisać poprawny kod Eircode.','Newest Scheduled Date'=>'Najnowsza zaplanowana data','Oldest Scheduled Date'=>'Najstarsza zaplanowana data','Count'=>'Liczba','Action Status'=>'Status akcji','Action Scheduler'=>'Harmonogram akcji','The %s class can only be run within WP CLI.'=>'Klasa %s może być uruchomiona tylko w ramach WP CLI.','Decrease existing stock by:'=>'Zmniejsz stan magazynowy o:','Increase existing stock by:'=>'Zwiększ stan magazynowy o:','View progress &rarr;'=>'Zobacz postęp &rarr;','Learn more about updates'=>'Dowiedz się więcej o aktualizacjach','Update WooCommerce Database'=>'Zaktualizuj bazę danych WooCommerce','The database update process runs in the background and may take a little while, so please be patient. Advanced users can alternatively update via %1$sWP CLI%2$s.'=>'Proces aktualizacji bazy danych przebiega w tle i może zająć trochę czasu, więc prosimy o cierpliwość. Zaawansowani użytkownicy mogą alternatywnie aktualizować poprzez %1$sWP CLI%2$s.','WooCommerce has been updated! To keep things running smoothly, we have to update your database to the newest version.'=>'WooCommerce został zaktualizowany! Aby wszystko działało sprawnie, musimy zaktualizować bazę danych do najnowszej wersji.','WooCommerce database update required'=>'Wymagana aktualizacja bazy danych WooCommerce','WooCommerce is updating the database in the background. The database update process may take a little while, so please be patient.'=