'Pole %s','These options let you change the appearance of the WooCommerce checkout.'=>'Te opcje pozwalają dostosować wygląd formularza zamówienia WooCommerce.','I have read and agree to the website %s'=>'Przeczytałem/am i akceptuję %s','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard przekierowuje kupujących do serwisu PayPal, aby wprowadzili dane płatności.','Optionally add some text for the terms checkbox that customers must accept.'=>'Opcjonalnie dodaj tekst do pola akceptacji Regulaminu, który muszą potwierdzić kupujący.','Log PayPal events, such as IPN requests, inside %s Note: this may log personal information. We recommend using this for debugging purposes only and deleting the logs when finished.'=>'Rejestruj zdarzenia PayPal, takie jak żądania IPN, w %s Uwaga: może to oznaczać dane osobowe. Zalecamy używanie tego tylko do celów debugowania i usuwania dzienników po zakończeniu.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Zobacz <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">politykę prywatności PayPal</a>, aby uzyskać więcej szczegółów.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Akceptujemy płatności przez PayPal. Podczas przetwarzania płatności niektóre z twoich danych zostaną przekazane firmie PayPal, w tym informacje wymagane do przetworzenia lub obsługi płatności, takie jak wartość zamówienia i informacje rozliczeniowe.','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Przyjmuj płatności za pomocą czeków. Ta metoda płatności offline może być użyteczna przy testowaniu zamówień.','Any &quot;%1$s&quot; method'=>'Każda metoda &quot;%1$s&quot;','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Przyjmuj płatności za pomocą przelewu bankowego.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'W tej sekcji umieść listę operatorów płatności, z których korzystasz, aby przyjmować płatności, ponieważ mogą oni przetwarzać dane klientów. Jako przykład podaliśmy PayPal, ale usuń te informacje, jeśli nie korzystasz z PayPala.','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'W tej sekcji umieść listę podmiotów, którym udostępniasz dane i w jakim celu to robisz. Lista może zawierać w szczególności usługi analityczne, marketingowe, bramki płatności, kurierów oraz osadzone treści.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Udostępniamy informacje z podmiotami trzecimi, które pomagają nam procesować zamówienia i dostarczają usługi, np.:','Customer information like your name, email address, and billing and shipping information.'=>'Informacje o klientach, takie jak imię i nazwisko, adres e-mail i informacje dotyczące fakturowania i wysyłki.','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Członkowie naszego zespołu mają dostęp do informacji, które nam podajesz. Np. administratorzy i obsługa sklepu mają dostęp do:','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Szczegóły zamówień, takie jak kupione pozycje, data zamówienia, adres wysyłki i','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Nasz zespół ma dostęp do tych informacji, aby obsługiwać zamówienia, zwroty oraz oferować wsparcie.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Ogólnie informacje są przechowywane tak długo, jak potrzebujemy informacji dla celów, dla których je gromadzimy i wykorzystujemy, i nie jesteśmy prawnie zobowiązani do dalszego przechowywania. Na przykład przechowujemy informacje o zamówieniach przez XXX lat dla celów podatkowych i księgowych. Obejmuje to imię i nazwisko, adres e-mail oraz adresy.','We will also store comments or reviews, if you choose to leave them.'=>'Będziemy również przechowywać komentarze i opinie, jeśli zdecydujesz się je napisać.','What we share with others'=>'Co dzielimy z innymi','Who on our team has access'=>'Kto w naszym zespole ma dostęp','Comply with any legal obligations we have, such as calculating taxes'=>'Spełnienie zobowiązań prawnych, np. obliczania podatków','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Jeśli utworzysz konto, zachowamy twoje imię i nazwisko, adres, e-mail oraz numer telefonu, które będą wykorzystane przy składaniu następnych zamówień.','Improve our store offerings'=>'Ulepszanie oferty sklepu','Process payments and prevent fraud'=>'Procesowanie płatności i zapobieganie oszustwom','Respond to your requests, including refunds and complaints'=>'Odpowiadanie na twoje zgłoszenia, w tym zwroty i reklamacje','Send you information about your account and order'=>'Przesyłanie informacji o twoim koncie i zamówieniach','Send you marketing messages, if you choose to receive them'=>'Wysyłanie informacji marketingowych, jeśli zgodzisz się na ich otrzymywanie','Set up your account for our store'=>'Założenie konta w naszym sklepie','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Gdy kupujesz w naszym sklepie, poprosimy cię o podanie informacji zawierających imię i nazwisko, adresy płatności i wysyłki, e-mail, telefon, dane płatności lub karty i opcjonalne dane konta: nazwa użytkownika i hasło. Będziemy wykorzystywać te informacje w poniższych celach:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Uwaga: możesz uszczegółowić swoje zasady dotyczące plików cookie i dodać link do tej sekcji w tym miejscu.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Będziemy również używać plików cookie do śledzenia zawartości koszyka podczas przeglądania naszej witryny.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Adres wysyłki: poprosimy cię o wpisanie adresu, abyśmy mogli na przykład oszacować koszty wysyłki przed złożeniem zamówienia i wysłać zamówienie!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Lokalizacja, adres IP i przeglądarka: użyjemy tych danych do oszacowania podatków i kosztów wysyłki','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Przeglądane produkty: użyjemy tych informacji, aby na przykład pokazać ci ostatnio oglądane produkty','We collect information about you during the checkout process on our store.'=>'Zbieramy informacje o tobie podczas składania zamówienia w naszym sklepie.','What we collect and store'=>'Jakie informacje zbieramy i przechowujemy','While you visit our site, we’ll track:'=>'Podczas przeglądania naszej witryny, będziemy zbierać następujące informacje:','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Ten przykładowy tekst zawiera podstawowe informacje o zbieraniu, przechowywaniu i udostępnianiu danych oraz kto może mieć do nich dostęp. Te informacje mogą się zmienić w zależności od ustawień lub dodatkowych wtyczek. Rekomendujemy zasięgnięcie opinii prawnika w sprawie polityki prywatności.','Order Number'=>'Numer zamówienia','Items Purchased'=>'Zakupione pozycje','Access granted'=>'Dostęp przyznany','Download count'=>'Liczba pobrań','Browser User Agent'=>'User Agent przeglądarki','Payment Tokens'=>'Tokeny płatności','Token'=>'Token','User email'=>'Adres e-mail użytkownika','display name%1$s %2$s'=>'%1$s %2$s','%1$s has been removed from your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'%1$s został usunięty z twojego koszyka ponieważ został w międzyczasie zmodyfikowany. Możesz dodać go do koszyka ponownie <a href="%2$s">tutaj</a>.','Cloning is forbidden.'=>'Klonowanie jest niedozwolone.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Wygląda na to, że twój sklep nie korzysta z bezpiecznego połączenia. Rekomendujemy przesyłanie danych witryny za pomocą połączenia HTTPS, aby lepiej chronić dane użytkowników. <a href="%s">Dowiedz się więcej.</a>','optional'=>'opcjonalne','Display name cannot be changed to email address due to privacy concern.'=>'Nazwa wyświetlana nie może być zmieniona na adres e-mail ze względu na ochronę prywatności.','User roleCustomer'=>'Klient','User roleShop manager'=>'Kierownik sklepu','Phone Number'=>'Numer telefonu','Billing Postal/Zip Code'=>'Kod pocztowy płatności','Billing State'=>'Stan płatności','Shipping First Name'=>'Imię wysyłki','Shipping Last Name'=>'Nazwisko wysyłki','Shipping Company'=>'Firma wysyłki','Shipping City'=>'Miasto wysyłki','Shipping Postal/Zip Code'=>'Kod pocztowy wysyłki','Customer Data'=>'Dane klienta','Blog id of the record on the multisite.'=>'ID witryny dla tego elementu.','URL to edit the order'=>'Adres URL edycji zamówienia','Name of the customer for the order'=>'Nazwa klienta dla zamówienia','Order total formatted for locale'=>'Suma zamówienia sformatowana według ustawień językowych','If the payment was refunded via the API.'=>'Jeśli płatność została zwrócona przez API.','Parent product does not match current variation.'=>'Nadrzędny produkt nie pasuje do obecnego wariantu.','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'To narzędzie usunie wszystkie sesje użytkownika z bazy danych, włącznie z aktualnymi koszykami i koszykami zapisanymi w bazie danych.','Deleted all active sessions, and %d saved carts.'=>'Wszystkie aktywne sesje oraz zapisane koszyki (%d) zostały usunięte.','Unserializing instances of this class is forbidden.'=>'Wyodrębnianie instancji tej klasy jest niedozwolone.','Payment complete event failed.'=>'Płatność zakończona niepowodzeniem.','Update status event failed.'=>'Aktualizacja statusu nie powiodła się.','Error during status transition.'=>'Błąd podczas zmiany statusu.','Personal data removed.'=>'Dane osobowe zostały usunięte.','%d permissions deleted'=>'Uprawnienia zostały usunięte: %d','Access to Purchased Downloads'=>'Dostęp do kupionych plików do pobrania','Clean up download permissions'=>'Wyczyść uprawnienia pobierania','Customer download permissions have been retained.'=>'Uprawnienia klienta do pobierania zostały zachowane.','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Ogranicz wyniki do produktów z wybranych atrybutem. Użyj nazwy taksonomii lub bezpośredniego odnośnika atrybutu.','Personal data within order %s has been retained.'=>'Dane osobowe z zamówienia %s zostały zachowane.','Purchased Downloads'=>'Kupione pliki do pobrania','Removed access to downloadable files.'=>'Dostęp do pobierania plików został usunięty.','Removed customer "%s"'=>'Klient "%s" został usunięty','Removed payment token "%d"'=>'Token płatności "%d" został usunięty','Removed personal data from order %s.'=>'Dane osobowe z zamówienia %s zostały usunięte.','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'To narzędzie usunie wygasłe uprawnienia do pobierania oraz uprawnienia z zerową liczbą pozostałych pobrań.','Unable to create order.'=>'Nie można utworzyć zamówienia.','Used-up download permissions'=>'Wykorzystane uprawnienia pobierania','Shipping State'=>'Województwo wysyłki','Please read and accept the terms and conditions to proceed with your order.'=>'Proszę przeczytać i zaakceptować regulamin, aby kontynuować składanie zamówienia.','Display name'=>'Wyświetlana nazwa','Billing City'=>'Miejscowość na dokumencie rozliczeniowym','Billing Last Name'=>'Nazwisko na dokumencie rozliczeniowym','Billing First Name'=>'Imię na dokumencie rozliczeniowym','Billing Company'=>'Firma na fakturze','Download ID'=>'Identyfikator pliku do pobrania','WooCommerce pages'=>'Strony WooCommerce','WooCommerce database version'=>'Wersja bazy danych WooCommerce','WordPress version'=>'Wersja WordPressa','WooCommerce version'=>'Wersja WooCommerce','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Jest dostępna nowsza wersja WordPressa (%2$s)','Settings tab labelPayments'=>'Płatności','Enable coupons'=>'Włącz kupony','Manage'=>'Zarządzaj','WordPress multisite'=>'WordPress multisite','WordPress memory limit'=>'Limit pamięci WordPressa','WordPress debug mode'=>'Tryb debug WordPressa','Secure checkout'=>'Bezpieczna strona zamówienia','Account endpoints'=>'Punkty końcowe konta','WordPress cron'=>'Cron WordPressa','Legacy API'=>'Przestarzałe API','Enable the legacy REST API'=>'Włącz przestarzałe REST API','Enable tax rates and calculations'=>'Włącz stawki podatkowe i obliczenia','Rates will be configurable and taxes will be calculated during checkout.'=>'Stawki będzie można skonfigurować, a podatki będą obliczane na stronie zamówienia.','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Nieudane zamówienia są nieopłacone i mogły zostać porzucone przez klienta. Zostaną one przeniesione do kosza po określonym czasie.','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Wstrzymane zamówienia są nieopłacone i mogły zostać porzucone przez klienta. Zostaną one przeniesione do kosza po określonym czasie.','Retain cancelled orders'=>'Zachowaj anulowane zamówienia','Retain completed orders'=>'Zachowaj zrealizowane zamówienia','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Zachowaj zrealizowane zamówienia przez określony czas przed anonimizacją danych.','Retain failed orders'=>'Zachowaj nieudane zamówienia','Displays whether or not WordPress is using an external object cache.'=>'Wyświetla, czy WordPress używa zewnętrznej pamięci podręcznej obiektów.','External object cache'=>'Zewnętrzna pamięć podręczna obiektów','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Anulowane zamówienia są nieopłacone i mogły być anulowane przez właściciela sklepu lub klienta. Zostaną przeniesione do kosza po określonym czasie.','Privacy policy'=>'Polityka prywatności','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Twoje dane osobowe zostaną użyte do obsługi twojej wizyty na naszej stronie, zarządzania dostępem do twojego konta i dla innych celów o których mówi nasza %s.','Allowed emails'=>'Dozwolone e-maile','Use previous column mapping preferences?'=>'Użyć poprzednich ustawień mapowania kolumn?','Remove personal data'=>'Usuń dane osobowe','Registration privacy policy'=>'Polityka prywatności rejestracji','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Opcjonalnie dodaj informacje na temat polityki prywatności sklepu, aby wyświetlić go w formularzu rejestracji konta.','Checkout privacy policy'=>'Polityka prywatności zamówień','Optionally add some text about your store privacy policy to show during checkout.'=>'Opcjonalnie dodaj informacje na temat polityki prywatności sklepu, aby wyświetlić go podczas składania zamówienia.','Accounts &amp; Privacy'=>'Konta i prywatność','Guest checkout'=>'Zamówienie bez rejestracji','Allow customers to place orders without an account'=>'Pozwól kupującym na składanie zamówień bez konta użytkownika','Allow customers to log into an existing account during checkout'=>'Pozwól kupującym logować się do istniejących kont podczas składania zamówienia','Allow customers to create an account during checkout'=>'Pozwól kupującym tworzyć konta podczas składania zamówienia','Allow customers to create an account on the "My account" page'=>'Pozwól klientom na tworzenie kont na stronie "Moje konto".','Account erasure requests'=>'Prośby o usunięcie kont','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Wybierz jak długo przechowywać dane osobowe, jeśli nie są już używane do realizacji zamówień. Pozostaw puste pole, aby nigdy nie usuwać danych.','Personal data retention'=>'Zachowywanie danych osobowych','Retain inactive accounts '=>'Zachowaj nieaktywne konta ','Retain pending orders '=>'Zachowaj wstrzymane zamówienia','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Nieaktywne konta to takie, na które nie było logowania lub zamówień przez określony czas. Zostaną one usunięte. Zamówienia zostaną skonwertowane na zamówienia gości.','privacy page'=>'strona prywatności','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Ta sekcja odpowiada za wyświetlanie polityki prywatności twojej witryny. Komunikaty dotyczące prywatności nie będą wyświetlane dopóki %s nie zostanie utworzona.','Filter by registered customer'=>'Filtruj wg zarejestrowanego klienta','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Lista dozwolonych adresów e-mail sprawdzanych z adresem e-mail klienta. Oddziel adresy przecinkami. Możesz też użyć gwiazdki (*), aby zastąpić części adresu e-mail. Np. "*@gmail.com" będzie miało zastosowanie do wszystkich adresów w domenie gmail.com.','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Twoje dane osobowe będą użyte do przetworzenia zamówienia, ułatwienia korzystania ze strony internetowej oraz innych celów opisanych w naszej %s.','Removed personal data from %s order.'=>'Usuń dane osobowe z %s zamówienia.' . "\0" . 'Usuń dane osobowe z %s zamówień.' . "\0" . 'Usuń dane osobowe z %s zamówień.','You can also:'=>'Możesz również:','Storefront icon'=>'Ikona Storefront