ct\'s page.'=>'Określ, czy wariant jest widoczny na stronie produktu.','This key is invalid or has already been used. Please reset your password again if needed.'=>'Klucz jest nieprawidłowy lub został już użyty. W razie potrzeby proszę zresetować hasło ponownie.','Order updated and sent.'=>'Zamówienie zostało zaktualizowane i wysłane.','Resend new order notification'=>'Wyślij ponownie e-mail o nowym zamówieniu','A list of your store\'s top-rated products.'=>'Lista najwyżej ocenianych produktów.','Display a list of a customer\'s recently viewed products.'=>'Lista ostatnio przeglądanych produktów.','Recent Product Reviews'=>'Najnowsze opinie produktów','Display a list of recent reviews from your store.'=>'Lista najnowszych opinii o produktach.','Filter Products by Rating'=>'Filtr produktów wg oceny','Display a list of star ratings to filter products in your store.'=>'Wyświetl listę gwiazdek w celu filtrowania produktów sklepie.','A list of your store\'s products.'=>'Lista produktów w sklepie.','A cloud of your most used product tags.'=>'Chmura najczęściej używanych tagów produktów.','Product Search'=>'Wyszukiwanie produktu','A search form for your store.'=>'Formularz wyszukiwania dla sklepu.','Maximum depth'=>'Maksymalna głębokość','Filter Products by Price'=>'Filtr produktów wg ceny','Display a slider to filter products in your store by price.'=>'Wyświetl suwak, aby filtrować produkty w sklepie według ceny.','Filter Products by Attribute'=>'Filtr produktów według atrybutu','Display a list of attributes to filter products in your store.'=>'Wyświetl listę atrybutów do filtrowania produktów w sklepie.','Active Product Filters'=>'Aktywne filtry produktu','Display a list of active product filters.'=>'Lista aktywnych filtrów produktu.','Display the customer shopping cart.'=>'Wyświetl koszyk klienta.','%1$s should not be called before the %2$s action.'=>'%1$s nie powinno być wywoływane przed akcją %2$s.','Please, provide an attribute name.'=>'Proszę wprowadzić nazwę atrybut