u — get tips, product updates, and inspiration straight to your mailbox.'=>'Jesteśmy tu dla Ciebie — otrzymuj porady, aktualizacje produktów i inspiracje bezpośrednio do swojej skrzynki pocztowej.','You\'re ready to start selling!'=>'Możesz rozpocząć sprzedaż!','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Twoja witryna może być w sieci prywatnej. Jetpack może łączyć się tylko z witrynami publicznymi. Upewnij się, że witryna jest dostępna przez Internet, a następnie spróbuj połączyć się ponownie 🙏.','Sorry! We couldn\'t contact Jetpack just now 😭. Please make sure that your site is visible over the internet, and that it accepts incoming and outgoing requests via curl. You can also try to connect to Jetpack again, and if you run into any more issues, please contact support.'=>'Przepraszamy! Nie możemy skontaktować się z Jetpack 😭. Upewnij się, że twoja strona jest dostępna przez Internet oraz, że akceptuje przychodzące i wychodzące połączenia przez curl. Możesz spróbować połączyć się ponownie z Jetpack, jeśli będziesz mieć problemy, skontaktuj się ze wsparciem technicznym.','Sorry! We tried, but we couldn\'t install Jetpack for you 😭. Please go to the Plugins tab to install it, and finish setting up your store.'=>'Przepraszamy! Próbowaliśmy, ale nie możemy zainstalować Jetpack 😭. Przejdź do zakładki Wtyczki, aby połączyć z Jetpack i zakończyć konfigurację sklepu.','Sorry! We tried, but we couldn\'t connect Jetpack just now 😭. Please go to the Plugins tab to connect Jetpack, so that you can finish setting up your store.'=>'Przepraszamy! Próbowaliśmy, ale nie możemy połączyć twojego sklepu z Jetpack 😭. Przejdź do zakładki Wtyczki, aby połączyć z Jetpack i zakończyć konfigurację sklepu.','Share new items on social media the moment they\'re live in your store.'=>'Udostępnij nowe produkty na portalach społecznościowych, gdy tylko pojawią się w