ze'=>'Autoryzuj','Get your API credentials from PayPal.'=>'Pobierz dane do API z PayPal.','Credit card'=>'Karta kredytowa','Enter a cost (excl. tax) or sum, e.g. <code>10.00 * [qty]</code>.'=>'Wpisz koszt (bez podatku) na zamówienie, np. 5.00. Domyślnie jest 0.','All allowed countries'=>'Wszystkie dozwolone kraje','Select some countries'=>'Wybierz kraje','Method availability'=>'Dostępność','A valid free shipping coupon'=>'Kuponu umożliwiającego darmową wysyłkę','A minimum order amount OR a coupon'=>'Minimalnej wartości zamówienia LUB kuponu','Users will need to spend this amount to get free shipping (if enabled above).'=>'Klienci będą musieli wydać tą kwotę, aby dostać darmową wysyłkę (jeśli tak jest ustawione powyżej).','Selected countries'=>'Wybrane kraje','Excluding selected countries'=>'Z wyjątkiem zaznaczonych krajów','Enable'=>'Włącz','How to calculate delivery charges'=>'W jaki sposób obliczyć opłatę za dostawę','Fixed amount'=>'Stała kwota','Percentage of cart total'=>'Procent od sumy koszyka','Fixed amount per product'=>'Stała opłata na produkt','What fee do you want to charge for local delivery, disregarded if you choose free. Leave blank to disable.'=>'Opłata za dostawę, pomijana, jeśli wybierzesz darmową dostawę. Pozostaw puste, aby wyłączyć.','Separate codes with a comma. Accepts wildcards, e.g. <code>P*</code> will match a postcode of PE30. Also accepts a pattern, e.g. <code>NG1___</code> would match NG1 1AA but not NG10 1AA'=>'Kody oddziel przecinkami. Maski wieloznaczne są akceptowane, np. <code>P*</code> będzie pasować do kodu PE30. Akceptowane również są wzorce, np. <code>NG1___</code> będzie pasować do NG1 1AA ale nie do NG10 1AA','Shipping costs updated.'=>'Koszty wysyłki zaktualizowane.','Accept COD if the order is virtual'=>'Akceptuj "za pobraniem", jeśli zamówienie jest wirtualne','Order complete emails are sent to customers when their orders are marked completed and usually indicate that their orders have been shipped.'=>'E-maile o zrealizowanych zamówieniach są wysyłane, gdy zamówienia zostaną oznaczone jako zrealizowane i zwykle oznaczają wysyłkę zamówień.','Pay with cash upon delivery.'=>'Płatność za pobraniem.','If COD is only available for certain methods, set it up here. Leave blank to enable for all methods.'=>'Jeśli ta metoda płatności ma być dostępna tylko dla wybranych sposobów wysyłki, ustaw je tutaj. Pozostaw puste, aby włączyć dla wszystkich.','Optionally enable "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.'=>'Opcjonalnie włącz "transfer danych płatności (Payment Data Transfer)" (Profil> Profil i Ustawienia> Moje narzędzia sprzedaży> Preferencje WWW), a następnie skopiuj tutaj swój token. Pozwoli to na weryfikację płatności bez potrzeby PayPal IPN.','Supports the following placeholders: <code>[qty]</code> = number of items, <code>[cost]</code> = cost of items, <code>[fee percent="10" min_fee="20"]</code> = Percentage based fee.'=>'Wspierane są symbole <code>[qty]</code> = liczba produktów, <code>[cost]</code> = koszt produktów, <code>[fee percent="10" min_fee="20"]</code> = opłata procentowa.','These rates are extra shipping options with additional costs (based on the flat rate).'=>'Te stawki umożliwiają dodanie nowych sposobów wysyłki (oparte na płaskiej stawce).','New order emails are sent to chosen recipient(s) when a new order is received.'=>'E-maile o nowym zamówieniu są wysyłane po otrzymaniu zamówienia.','Payment for order %s reversed'=>'Płatność do zamówienia %s została wycofana','What ZIP/post codes are available for local delivery?'=>'Które kody pocztowe są dostępne dla lokalnej dostawy?','Customer note'=>'Notka dla klienta','A note has been added to your order'=>'Nowa notka została dodana do Twojego zamówienia','Availability'=>'Dostępność','This is an order notification sent to customers containing order details after